CREATE TABLE IF NOT EXISTS "core_order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "order_type" varchar(16) NOT NULL, "price" decimal NOT NULL, "user_id" integer NOT NULL REFERENCES "core_user" ("id") DEFERRABLE INITIALLY DEFERRED, "create_date" datetime NOT NULL, "modified_date" datetime NOT NULL, "is_active" bool NOT NULL, "currency_pair_id" integer NOT NULL REFERENCES "core_currencypair" ("id") DEFERRABLE INITIALLY DEFERRED, "amount" decimal NOT NULL, "original_amount" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "core_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "core_currency" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "verbose_name" varchar(64) NOT NULL, "acronym" varchar(8) NOT NULL UNIQUE, "currency_type" varchar(16) NOT NULL, "name" varchar(64) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "core_trade" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "buyer_order_id" integer NOT NULL REFERENCES "core_order" ("id") DEFERRABLE INITIALLY DEFERRED, "seller_order_id" integer NOT NULL REFERENCES "core_order" ("id") DEFERRABLE INITIALLY DEFERRED, "create_date" datetime NOT NULL, "modified_date" datetime NOT NULL, "is_active" bool NOT NULL, "amount" decimal NOT NULL, "price" decimal NOT NULL);
